package Java;

public class swapping {

	public static void main(String[] args) {
		// TODO Auto-generated method stub


		int a= 20, b= 34;
		 
		 System.out.println("Before Swapping a= "+a+" and b= "+b);
		 // Swapping The numbers
		 
		 int swap = a;
		 a=b;
		 b=swap;
		 
		 System.out.println("After Swapping a = "+a+" And b = "+b);
	}

}
